import { Component } from "react"
import Layout1 from "../../layouts/layout1"
import LoadingPage from "../../components/SharedComp/LoadingPage"
import { Breadcrumb, Col, Row } from "antd"
import { dataPhotoCatories } from "../../data/data"

class PhotoPage extends Component {

    state = {
        loading: false
    }

    renderBreadcrumb = () => {
        return <Breadcrumb>
            <Breadcrumb.Item>
                <h1>Home Design Ideas</h1>
            </Breadcrumb.Item>
        </Breadcrumb>
    }

    renderCategory = () => {
        return dataPhotoCatories.map((res,i) => {
            return (
                <Col span={3}>
                    <div className="itemCate mb-10">
                        <img style={{width:'100%'}} src={`/images/${res.url}`} />
                        <span className="d-block text-center p-20">{res.name}</span>
                    </div>
                </Col>
            )
        })
    }

    render(){
        const breadcrumb = this.renderBreadcrumb();
        const dataPhotoCategories = this.renderCategory();

        return (
            <Layout1>
                <LoadingPage isLoading={this.state.loading}>
                    <div className="container">
                        {breadcrumb}
                    </div>
                    <div className="photosCategory container" style={{background:'white'}}>
                        <Row>
                            {dataPhotoCategories}
                        </Row>
                    </div>
                </LoadingPage>
            </Layout1>
        )
    }
}

export default PhotoPage
